import { Button, Container, Typography } from "@mui/material";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { endSession, getSession, isLoggedIn } from "../../storage/session";
import App from "../../App";


export default function User() {

  let navigate = useNavigate();

  const [email, setEmail] = useState("");

  useEffect(() => {
    if (!isLoggedIn()) {
      navigate("/login");
    }

    let session: any = getSession();
    setEmail(session.email);

    console.log("Your access token is: " + session.accessToken);
  }, [navigate]);

  const onLogout = () => {
    endSession();
    navigate("/login");
  }

  return (
    <>
      <App />
      <Container maxWidth="xs" sx={{ mt: 2 }}>
        <Typography variant="h6" component="h1" textAlign="center" gutterBottom>
          You're logged in as:
        </Typography>
        <Typography variant="h5" component="h1" textAlign="center" gutterBottom>
          {email}
        </Typography>
        <Button variant="contained" color="error" onClick={onLogout} sx={{ mt: 3 }} fullWidth>
          Log out
        </Button>
      </Container>
    </>
  )
}
